import React from 'react'
import  Universitydetails  from './Universitydetails'
import { uproducts } from './uproducts'

export function University() {

    return (
        <div className='md-3'>
            {uproducts.map((uproduct) => (
                <Universitydetails uproduct={uproduct} />
            ))}
        </div>
    )
}
